import React from "react";

import { Form, Formik } from 'formik';
import { Link } from "react-router-dom";
import * as Yup from 'yup';
import { useSelector, useDispatch } from "react-redux";

import { verifyPassword } from '../../../actions/authentication'
import MyTextField from '../../common/textfield'
import backIcon from './assets/backicon.png';
import "./password.scss";

export default function Password(props) {
    const dispatch = useDispatch();

    return (
        <div className='welcome'>
            <div className="container">

                <span onClick={() => props.goToUsername()}>
                    <img src={backIcon} alt="backicon" className='backButton'/>
                </span>

                <div className="mainTitle centerText">Welcome</div>

                <div className="usernameTitle centerText">johnsmith</div>

                <Formik
                    initialValues={{ password: '' }}

                    validationSchema={SigninPasswordSchema}

                    onSubmit={(values, actions) => {
                        dispatch(verifyUsername(values))

                        console.log(actions)
                        // actions.setFieldError('password' , 'wrong password request from server')
                        // setTimeout(() => {
                        //     alert(JSON.stringify(values, null, 2));
                        //     actions.setSubmitting(false);
                        // }, 1000);
                    }}
                >
                    {(props) => (
                        <Form>
                            <MyTextField name="password" type="text" label="Password" />
                            <button type="submit">Submit</button>
                        </Form>
                    )}
                </Formik>

            </div>

            <div className="centerText commonLabels">
                New to Autodesk ?  <Link to="/account">Create account</Link>
            </div>

            <div className="footer commonLabels">
                <p>Your account for everything Autodesk</p>
                <a href={''} >Learn More</a>
            </div>

        </div>
    );
}

const SigninPasswordSchema = Yup.object().shape({
    password: Yup.string().required('Please enter a valid password')
});
